column8:
出産祝いに、ココレカのおむつケーキが喜ばれています。<br>


<img src="https://image.rakuten.co.jp/cocoleca/cabinet/mcommune/03451380/ima-twinb-01.jpg" width="728" border="0">
<br>

<p><font size="+1"><b>今治タオル　ふたごのオムツケーキ</b></font></p><br>
<br>
<p>ココレカで一番人気の今治タオルのおむつケーキシリーズから、双子の赤ちゃん専用のおむつケーキが登場です！<br>
<br>
「おむつケーキを贈りたいけど、双子の赤ちゃんへ贈るにはどうしたらいいだろう・・・」と<br>
お悩みの方にオススメしています＾＾<br>
<br>
Sassyの歯固め二つと、吸水性抜群の日本製「今治タオル」のフェイスタオルが2枚付いていて、<br>2枚共お名前刺繍を無料でいたします♪<br>
<br>
双子の赤ちゃん、とってもかわいいですよね！私の友人にも双子が産まれて、成長の度に仲良く遊んでいる姿は<br>微笑ましく思いました。<br>
<br>
ママのお腹の中でずっと一緒だった二人が、産まれてからも仲良く元気に育ってくれますようにっという願いを込めて、<br>お贈りしてはいかがでしょうか＾＾<br>
<br></p><br>

<img src="https://image.rakuten.co.jp/cocoleca/cabinet/mcommune/03451380/ima-twinb-02.jpg" width="728" border="0">
<br>

<p><font size="+1"><b>男の子と女の子の双子もお任せください</b></font></p><br>
<br>
<p>今治タオルのカラーはブルーとピンクですが、それぞれ1枚づつ巻いてお作りできますので、男の子と女の子の双子にも<br>
<br>
お贈りする事ができます。<br>
<br>
通常のおむつケーキだと、このようなカラーのバランスも考えるのが大変ですよね。<br>
<br>
こちらのおむつケーキでしたら安心してお贈りいただけます＾＾<br>
</p><br>
<img src="https://image.rakuten.co.jp/cocoleca/cabinet/mcommune/03451380/ima-twinb-03.jpg" width="728" border="0">
<br>

<p><font size="+1"><b>オシャレで上質な5treesのフェイスタオル</b></font></p><br>
<br>
<p>シンプルなボーダーデザインと思っていたら、センターから2色に分かれるデザインとなっていて、<br>仕上がりも日本製の質の高さがわかります。<br>
<br>
吸水性が高い今治タオルなので、使い始めからも水や汗を良く吸収してくれて、長く使っても柔らかい風合いが続きます＾＾<br>
<br>
子育ての時にこんなタオルがあったら、とっても嬉しいですよね♪<br>
<br>
当店のタオルソムリエが自信を持ってオススメするタオルです。<br>
</p><br><b>双子（ふたご）のおむつケーキ （今治タオルとサッシーのおもちゃ）</b><br>

■用途：出産祝い、ハーフバースデー<br>
  ■素材：Sassyの歯固め：ABS樹脂、合成ゴム、綿、ポリプロピレン、ポリエステル<br>
　　　　今治タオル：綿100％<br>
  ■セット内容：<br>
　　　・おむつケーキ土台：紙おむつ<br>
  　　　　（パンパースはじめての肌へのいちばん）<br>
  　　　└Sサイズ（38枚）<br>
  　　　└Mサイズ（33枚）<br>
  　　　・SASSYの歯固め×2個<br>
　　　・今治タオル 5trees フェイスタオル 2枚<br>
  　　　・フェルト、リボン、造花<br>
  ■ラッピングをしてお届けします。<br>
  ■ギフトオプション：以下のギフトオプション対応です<br>
